import React, { useState } from "react";
import {
  Box,
  HStack,
  Flex,
  Heading,
  Link,
  Button,
  IconButton,
  Menu,
  MenuButton,
  MenuList,
  MenuItem,
  useColorMode,
  useMediaQuery,
} from "@chakra-ui/react";
import { HamburgerIcon, CloseIcon } from "@chakra-ui/icons";

const Navbar = () => {
  return (
    <Box p={4}>
      <HStack spacing={4}>
        <Link to="/">
          <Button>Home</Button>
        </Link>
        <Link to="/about">
          <Button>About</Button>
        </Link>
        <Link to="/contact">
          <Button>Contact</Button>
        </Link>
        <Link to="/work">
          <Button>Work</Button>
        </Link>
      </HStack>
    </Box>
  );
};

export default Navbar;
